import perro from "../media/audio/dog.mp3";
import gta from "../media/audio/gta.mp3";
import ReactPlayer from "react-player";
const Listening = () => {
  return (
    <>
      <ReactPlayer
        url="https://www.youtube.com/watch?v=ysz5S6PUM-U"
        playing={true}
      />
    </>
  );
};

export default Listening;
